import { makeStyles } from "@material-ui/core";

const homePageStyles = makeStyles({
  root: {
    width: "90vw",
    height: "84vh",
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%,-50%)",
    overflow: "auto",
    borderRadius: 0,
  },
  tableBody: {
    "&:nth-child(even) tr:nth-child(odd)": {
      backgroundColor: "#F6F6F6",
    },
  },
  tableCell: {
    border: "none",
    padding: "10px",
  },
});

export default homePageStyles;
